import React from "react";

const Home = () => {
  return (
    <div style={{ display: "flex" }}>
      <div>
        <img
          src={
            process.env.PUBLIC_URL +
            "/profileImages/096jpg_8382897_31103527.jpg"
          }
        />
      </div>
      <div>
        <img src={process.env.PUBLIC_URL + "/6512729.jpg"} />} />
      </div>
    </div>
  );
};

export default Home;
